import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';

let dialogsData = [
    {id: 1, name: 'Dima'},
    {id: 2, name: 'Andre'},
    {id: 3, name: 'Sasha'},
]
let messagesData = [
    {id: 1, message: 'hi'},
    {id: 2, message: 'hi'},
    {id: 3, message: 'hi'},
    {id: 4, message: 'hi'},
]
ReactDOM.render(


  <React.StrictMode>
    <App dialogsData = {dialogsData} messagesData = {messagesData}/>
  </React.StrictMode>,
  document.getElementById('root')
);

reportWebVitals();
